import React, { useState } from "react";

const ClickCounter = () => {
  const [count, setCount] = useState(0);
  return (
    <div>
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        ClickCounter : {count}
      </button>
    </div>
  );
};

export default ClickCounter;
